CREATE TABLE IF NOT EXISTS `skripsi` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mahasiswa_nim` varchar(20) NOT NULL,
  `judul` text DEFAULT NULL,
  `status` enum('Lulus','Belum Lulus','Data Tidak Lengkap','Tidak Selesai') NOT NULL DEFAULT 'Data Tidak Lengkap',
  `tgl_sk_pembimbing` date DEFAULT NULL,
  `tgl_lulus` date DEFAULT NULL,
  `jumlah_pengambilan` int(11) NOT NULL DEFAULT 1 COMMENT 'Melacak berapa kali skripsi ini diambil',
  `pembimbing_1_id` int(11) DEFAULT NULL,
  `pembimbing_2_id` int(11) DEFAULT NULL,
  `penguji_1_id` int(11) DEFAULT NULL,
  `penguji_2_id` int(11) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `mahasiswa_nim` (`mahasiswa_nim`),
  KEY `pembimbing_1_id` (`pembimbing_1_id`),
  KEY `pembimbing_2_id` (`pembimbing_2_id`),
  KEY `penguji_1_id` (`penguji_1_id`),
  KEY `penguji_2_id` (`penguji_2_id`),
  CONSTRAINT `skripsi_ibfk_1` FOREIGN KEY (`mahasiswa_nim`) REFERENCES `mahasiswa` (`nim`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `skripsi_ibfk_2` FOREIGN KEY (`pembimbing_1_id`) REFERENCES `dosen` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `skripsi_ibfk_3` FOREIGN KEY (`pembimbing_2_id`) REFERENCES `dosen` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `skripsi_ibfk_4` FOREIGN KEY (`penguji_1_id`) REFERENCES `dosen` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `skripsi_ibfk_5` FOREIGN KEY (`penguji_2_id`) REFERENCES `dosen` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=405 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DELETE FROM `skripsi`;

